import React, { useContext, useEffect } from "react";
import { Login } from "../../auth/Login";
import { Register } from "../../auth/Register";
import styled from "styled-components";
import { AuthScope } from "../../../models/AuthScope";
import { AuthContext } from "../../../contexts/auth/Auth";
import { UserDashboard } from "./UserDashboard";
import { Wrapper } from "../../UI/Wrapper";

interface Props {
  activity: AuthScope;
}

export const PrivateSection: React.FC<Props> = ({ activity }) => {
  const { currentUser, goToPrivateSection } = useContext(AuthContext);

  useEffect(() => goToPrivateSection(), []);

  return currentUser ? (
    <UserDashboard />
  ) : (
    <Wrapper>{activity === "login" ? <Login /> : <Register />}</Wrapper>
  );
};
